import React, {useState} from "react";
import Modal from "react-modal";
import r7 from '../images/r7.jpeg';

const R7 = () => {
  const [modal_IsOpen, set_IsOpen] = useState(false);

  const openModal = () => {
    set_IsOpen(true);
  }

  const closeModal = () => {
    set_IsOpen(false);
  }

  return (
    <>
      <img onClick={openModal} className="square" src={r7} />
      <Modal 
        isOpen={modal_IsOpen}
        onRequestClose={closeModal}
        className="modal"
        ariaHideApp={false}
        closeTimeoutMS={200}
        onAfterOpen
        >
        <div className="container-img">
          <img className="img" src={r7} />
          <button onClick={closeModal} className="btn">Back</button>
        </div>
        </Modal>
    </>
  )
}

export {R7 as default};
